	function parallaxScroll(){
		var scrolled 	= $(window).scrollTop()
			pos 		= 0 - (scrolled * .025) + 'px';
		 $('.js-paralax').css('transform', 'translateY(' + pos + ')');
	};

	// height section Top
	function heightTop(){
		$('.js-top').each(function(){
			var this_ 	= $(this),
				wHeight = $(window).height();
			if (wHeight >= 801){
				this_.height(wHeight);
			}
			else {
				this_.height('auto');
			}
		});
	} heightTop();

